import img from "../testimag.jpeg";

function createGrid() {
  const cells = [];
  for (let w = 4; w < 104; w++) {
    cells.push(
      <div
        id={w}
        className="cells"
        key={w}
        onClick={(e) => console.log(e.target.id)}
      ></div>
    );
  }
  return cells;
}
const Home = () => {
  return (
    <div id="home">
      <div id="grid-container" style={{ backgroundImage: "url(" + img + ")" }}>
        {createGrid()}
      </div>
    </div>
  );
};

export default Home;
